import { useState } from 'react';
import { Grid, Typography, Box, Button, Modal } from '@material-ui/core';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  root: {
    maxWidth: 100,
  },
  media: {
    height: 100,
  },
});
function Footer({ list }) {


  const classes = useStyles();

  return(
    // <Grid container direction='row'>
    //   <Grid item xs={6}>
    //     <h1>Crawl list to go here</h1>
    //   </Grid>
    //   <Grid item xs={6}>
    //     <h1>Finalize button to go here</h1>
    //   </Grid>
    // </Grid>

    <>

    {list?.map((item) =>
      <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={`https://maps.googleapis.com/maps/api/place/photo?maxwidth=400&photo_reference=${item?.photo}&key=AIzaSyDSIQ1d7mi0UkmqcOVJICPOh43Oa-i1byc`}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="subtitle2" component="h2">
            {item.name}
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">

          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
        <Button size="small" color="primary">
          Learn More
        </Button>
      </CardActions>
    </Card>
    )}
    </>

  )
}

export default Footer;
